// Đẩy mảng product vào local storage
function Save() {
    localStorage.setItem('listProduct', JSON.stringify(products));
}
// Lấy sản phẩm từ local storage
function load() {
    product = JSON.parse(localStorage.getItem('listProduct'));
}
// Xuất sản phẩm ra html
